// Purpose -- of this test script is to inject the values and variables from this
// endpoint call into the environment variables for Postman

if(responseCode.code === 200) {
    var data = JSON.parse(responseBody);
    var numEndpoints, endpoint; 

    numEndpoints = data.items.length;

    for (var i = 0; i < numEndpoints; i++) {
        endpoint = data.items[i];
        // set all of the endpoint values in case we need them in the future
        postman.setEnvironmentVariable(endpoint.type, endpoint.url);

        // soap & rest have specific variable names, so if we run into those
        // set them to the appropriate names
        if(endpoint.type == "soap") {
            postman.setEnvironmentVariable("soapEndPoint", endpoint.url);
        }

        if(endpoint.type == "restProd") {
            postman.setEnvironmentVariable("hostEndpoint", endpoint.url);            
        }
    }
}

